import React from 'react'

export default function EmojiBox() {

    const emojis = ["❤️", "😀", "⭐️"]

    const onEmojiClick = (ev) => {
        ev.stopPropagation();
    }

    return (
        <div className="emoji-container flex">
            {emojis && emojis.map((emoji) =>  <button className="emoji-btn" onClick={onEmojiClick}>emoji</button>)}
        </div>
    )
}
